Interweave Crochet Accessories Special Issue 2011

This super-sized special issue of Interweave Crochet Accessories includes 144 pages of crochet know-how and patterns!

With more than 59 projects, you'll be crocheting well into the new year and beyond. In addition to 14 one-skein projects, the issue includes a slew of stash-busting projects.

For beginning crocheters, there is a guide to crochet that includes a freeform bag pattern great for crocheters of all levels.

Small projects let you practice Tunisian, double-ended crochet, lace, intarsia, threadwork, and more. You'll find the perfect gift for everyone on your list, along with projects that you'll turn to again and again.
